import './App.css';
import { useState } from 'react'

function App() {
  const [display, setdisplay] = useState([])
  let clk = () => {
    fetch("https://jsonplaceholder.typicode.com/posts")
      .then(fetchdata => fetchdata.json())
      .then(jsondata => setdisplay(jsondata))
  }
  return (
    <div>
      <button className="btn" onclick={clk}>click here</button>
      {<div>{display.length > 0 &&
        display.map((a) =>
          <p>{a.title}</p>
        )}
      </div>}
    </div>
  );
}

export default App;
